public ContainerHistoryData getContainer(ContainerId containerId) {
  Map<ContainerId, ContainerHistoryData> subMap =
      containerData.get(containerId.getApplicationAttemptId());
  if (subMap == null) {
    return null;
  } else {
    return subMap.get(containerId);
  }
}
